$(document).ready(function(){
$('.rating').click(function(){
  var user_id = $(this).attr('data-user-id');
  var stars = $(this).rating('rate');
  console.log(stars);
  $.ajax({
    type: 'post',
    url: '/users/' + user_id + '/rate',
    data: {rating: stars}
  }); 
});
})
